import "./Home.css";
import FacebookIcon from '@material-ui/icons/Facebook';
import TwitterIcon from '@material-ui/icons/Twitter';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

function Home() {
  return (
    <div className ="home">

  <div className="home__container1">

    <div className="home__container1_left ">

     <div className="home__container1_left_option facebook">
    <a href="https://www.facebook.com/"><FacebookIcon className="left_option_icon"/></a>
     </div>
     <div className="home__container1_left_option twitter">
     
     <a href="https://www.twitter.com"><TwitterIcon className="left_option_icon"/></a>
     
     </div>
     <div className="home__container1_left_option linkedin">
     
     <a href="https://www.linkedin.com"><LinkedInIcon className="left_option_icon" /></a>
     
     </div>

    </div>

    <div className="home__container1_right">

    </div>
    
  </div>

    </div>


  );
}

export default Home;
